export default function ProfileGallery() {
  const t = useTranslations('Common')
  const [activeTab, setActiveTab] = useState<Tab>(Tab.All)

  const tabs = [
    { label: 'แกลลอรี่ทั้งหมด', value: Tab.All },
    { label: 'ครอบครอง', value: Tab.Occupy },
    { label: 'กำลังปล่อยเช่า', value: Tab.RentingOut },
    { label: 'กำลังเปิดประมูล', value: Tab.Auction },
    { label: 'ประวัติการปล่อยเช่า', value: Tab.RentalHistory },
  ]

  const isActiveTab = (tab: Tab) => tab === activeTab

  return (
    <>
      <h2 className="col-span-full mb-8 flex items-center gap-[5%] text-2xl font-bold">
        <HeaderDecorate />
        {t('gallery')}
        <HeaderDecorate />
      </h2>
      <div className="col-span-full mb-[60px]">
        <div className="mb-8 flex gap-5">
          {tabs.map(tab => (
            <button key={tab.value} type="button" onClick={() => setActiveTab(tab.value)} className={cn('flex items-center gap-1 text-2xl', isActiveTab(tab.value) && 'font-bold')}>
              {isActiveTab(tab.value) && <ActiveIcon />}
              {tab.label}
              {isActiveTab(tab.value) && <ActiveIcon />}
            </button>
          ))}
        </div>
        <div className="grid grid-cols-5 gap-4">
          {
            products.map(product => product.category === Category.Product
              ? (
                  <ProductCard
                    key={product.id}
                    product={product}
                  />
                )
              : <AuctionCard key={product.id} auction={product as Auction} />)
          }
        </div>
      </div>
    </>
  )
}

